import React,{Component} from 'react';
import Header from '../Common/Header/Header';
import {Link} from 'react-router-dom';

import '../assets/css/shop.css';

import image from '../assets/img/shop-info-bg.jpg';

class Shop extends Component {
    render(){
        return(
            <div>
                <div className="page-empty-banner col-lg-12 col-md-12 col-sm-12">
                    <div className="page-banner page-banner-tm">
                        <Link to="">
                            <img src={image} alt="" />
                        </Link>
                    </div>
                    <div className="col-main">
                        <div className="container">
                            <div className="container-inner justify-content-center">
                                <div id="fpointstore_voucher_info" classname="fpointstore-page">
                                    <div className="fpointstore-header-menu">
                                        <ol id="fpointstore-page-menu">
                                            <li id="fpointstore_menu_item_0" className="fpointstore-menu-item" onClick="">
                                                <a>All</a>
                                                <hr/>
                                            </li>
                                        </ol>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Shop;
